type fakeAgent struct {
	Data []byte
	Err  error
}

func (a *fakeAgent) RetrieveFromAgent(endpoint string) ([]byte, error) {
	log.Infof("Retrieved from endpoint: %s\n", endpoint)

	return a.Data, a.Err // 根据 endpoint 返回预先设置的响应
}

func TestApi_GetLiveStatus(t *testing.T) {
	type fields struct {
		Server Agent
	}

	type args struct {
		secUserId string
	}

	tests := []struct {
		name    string
		fields  fields
		args    args
		want    bool
		wantErr bool
	}{
		{
			name: "TestLiveStatusTrue",
			fields: fields{
				Server: &fakeAgent{
					Data: []byte(`{"user": {"live_status": 1}}`),
					Err:  nil,
				},
			},
			args:    args{secUserId: "user1"},
			want:    true,
			wantErr: false,
		},
		{
			name: "TestLiveStatusFalse",
			fields: fields{
				Server: &fakeAgent{
					Data: []byte(`{"user": {"live_status": 0}}`),
					Err:  nil,
				},
			},
			args:    args{secUserId: "user2"},
			want:    false,
			wantErr: false,
		},
		{
			name: "TestLiveStatusError",
			fields: fields{
				Server: &fakeAgent{
					Data: []byte(`{"user": {"live_status": 0}}`),
					Err:  fmt.Errorf("error"),
				},
			},
			args:    args{secUserId: "user3"},
			want:    false,
			wantErr: true,
		},
	}
	for _, tt := range tests {
		t.Run(tt.name, func(t *testing.T) {
			a := &Api{
				Server: tt.fields.Server,
			}
			got, err := a.GetLiveStatus(tt.args.secUserId)
			if (err != nil) != tt.wantErr {
				t.Errorf("GetLiveStatus() error = %v, wantErr %v", err, tt.wantErr)
				return
			}
			if got != tt.want {
				t.Errorf("GetLiveStatus() got = %v, want %v", got, tt.want)
			}
		})
	}
}

